Drop database IF  EXISTS rqg;

create database rqg;
use rqg;

CREATE TABLE employee (
         id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
         name VARCHAR(100),
	 email VARCHAR(100));

CREATE TABLE VMs (
         id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
         RAM INT,
	 os VARCHAR(100),
         name VARCHAR(100),
         memory INT);

CREATE TABLE skills (
         id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
         name VARCHAR(100));

CREATE TABLE tasks_points (
         id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	 task1 INT,
         task2 INT);

CREATE TABLE emp_table (
         id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	 task_point_id INT,
         employee_id INT,
         skill_id INT,
	 join_day INT,
         join_mo INT,
         test_rate FLOAT,
  	 join_yr INT,
	 VM_id INT,
         job_title VARCHAR(100));

